//feelings selection
import React from 'react';
//import './App.css';
import FeelingComponent from'./feelingcomponent';

function Feelings() {
  return (
    <div className="Feelings">
        <h2>
        Let's log how you've been been feeling today...
        </h2>
        <p>
        Please select the emotion that applied best to your whole day. 
        </p>
        <FeelingComponent feeling="happy"></FeelingComponent>
        <FeelingComponent feeling="sad"></FeelingComponent>
        <FeelingComponent feeling="angry"></FeelingComponent>

    </div>
  );
}

export default Feelings;
